import React from 'react';
import styled from 'styled-components';

const Navbar = () => {
    return (
        <Nav>
            <Logo href="">
                ROBOT <span> Market</span>
            </Logo>

        </Nav>
    )
}

const Nav = styled.div`
    background: #ff0080;
    padding: 0 2rem;
    display: flex;
    justify-content: space-between;
    alighn-items: center;
    flex-wrap: wrap;
`;

const Logo = styled.a`
    padding: 1rem 0;
    color: #fff;
    text-decoration: none;
    font-weight: 800;
    font-size: 1.7rem;

    span {
        font-weight: 300;
        ont-size: 1.3rem;
    }

`;

const Menu = styled.div`
    display: flex;
    justify-content: space-between;
    align-items: center;
    postion: relative;

`;

const MenuLink = styled.a`
    padding: 1rem 2rem;
    text-align: center;
    text-decoration: none;
    color: #fff;
    curson: pointer;
    transition: all 0.3s ease-in;
    font-size: 1rem;

    &:hover {
        text-decoration: underline;
    }

`;

export default Navbar;
